description:
Subway Map Visualization Reloaded is heir to Subway Map Visualization jQuery Plugin that brings compatability with IE7+ browsers (if you may call it a 'browser'). SMVR uses excanvas.js to render  in outdated browsers. Few minor fixes are also provided:

Markers are drawn accordingly to it's line color;
Some wrong mistypes are corrected to the right mistypos.

Screw.Unit is a Behavior-Driven Testing Framework for Javascript. It features nested describes. Its goals are to provide:

a DSL for elegant, readable, organized specs;
an interactive runner that can execute focused specs and describes;
and brief, extensible source-code.
